import React from 'react';
import { BrowserRouter, Route, Routes} from 'react-router-dom';
import './sass/App.scss';

import LandingPage from './components/LandingPage/LandingPage';


function App() {
  return (
      <BrowserRouter>
        <div className='App'>
          <Routes>
            <Route path="/" element={<LandingPage/>}/>
          </Routes>
        </div>
      </BrowserRouter>
  );
}

export default App;
